import TestCar from './TestCar'

const TestingData = () => {
const carList = [
		{ name: 'Tesla Model 3', price: '46000' },
		{ name: 'Dodge Challenger', price: '26000' },
		{ name: 'Ford Mustang', price: '27000' },
	]

	const clist = carList.map((car) => (
		<TestCar key={car.id} name={car.name} price={car.price} />
	))
	return (
		<div>
			<h1>List Of Cars</h1>
			<ul>{clist}</ul>
		</div>
	)
}

export default TestingData
